import React, {Component} from 'react'
import styled from 'styled-components'
const Section = styled.section``
const FirstView = styled.div`
  display: flex;
  height: 100vw;
  margin-top: 7vh;
  width: 50vw;
`
const FirstViewLeft = styled.div`
  margin-left: 5vw;
`

const TitleText = styled.p`
  font-weight: bold;
  font-size: 32px;
  line-height: 120%;
  /* or 38px */

  /* Black */

  color: #242728;
`
const TitleSubText1 = styled.p`
font-style: normal;
font-weight: 500;
font-size: 14px;
line-height: 20px;
/* identical to box height, or 125% */

letter-spacing: 0.5px;

/* Green */

color: black;
`
const FormDiv= styled.div`
margin-left: 5vw;
font-weight: bold;
font-size: 20px;
line-height: 120%;
/* or 38px */

/* Black */

color: #242728;
margin-top: -1150px;
`

const LoginDiv = styled.div`
  background-color: white;
  height: 35vh;
  width: 15vw;
  opacity: 1;
`
const CompanyContainer = styled.div``
const CompanyTitle = styled.p`
  font-weight: bold;
`
const CompanyInput = styled.input`
border-top: none;
border-right: none;
border-left: none;
border-bottom: 1px solid black;
`
const FLnameContainer = styled.div`
  clear: both;
  display: inline-block;
  overflow: hidden;
  white-space: nowrap;
`

const FirstnameContainer = styled.div`
display: inline-block;

`
const FirstnameTitle = styled.p`
  font-weight: bold;
`
const FirstnameInput = styled.input`
border-top: none;
border-right: none;
border-left: none;
border-bottom: 1px solid black;
`
const LastnameContainer = styled.div`
display: inline-block;
margin-left: 10px;

`
const LastnameTitle = styled.p`
  font-weight: bold;
`

const LastnameInput = styled.input`
border-top: none;
border-right: none;
border-left: none;
border-bottom: 1px solid black;
`
const EmailContainer = styled.div``
const EmailTitle = styled.p`
  font-weight: bold;
`
const EmailInput = styled.input`
border-top: none;
border-right: none;
border-left: none;
border-bottom: 1px solid black;
`
const PhoneContainer = styled.div``
const PhoneTitle = styled.p`
  font-weight: bold;
`
const PhoneInput = styled.input`
border-top: none;
border-right: none;
border-left: none;
border-bottom: 1px solid black;
`

const ButtonsDiv = styled.div`
display: flex;
margin-top: 7vh;
width: 50vw;
margin-left: 5vw;
`
const PrevBtn = styled.button`

`
const NextBtn = styled.button`

`
class About extends Component {
  render() {
  return (
    <Section>
    <FirstView>
      <FirstViewLeft>
        <TitleText>Review your information</TitleText>
        <TitleSubText1>Complete your profile with your business details and basic information</TitleSubText1>
      </FirstViewLeft>

    </FirstView>
    <FormDiv>
    <CompanyContainer>
    <CompanyTitle>Company Name</CompanyTitle>
    <CompanyInput
    type='text'
    placeholder='Your brand name'
    />
    </CompanyContainer>
    <FLnameContainer>
    <FirstnameContainer>
      <FirstnameTitle>Your name</FirstnameTitle>
      <FirstnameInput
        type='text'
        placeholder='First Name'
      >
      </FirstnameInput>{' '}
    </FirstnameContainer>

    <LastnameContainer>
      <LastnameInput
        type='text'
        placeholder='Last Name'
      >
      </LastnameInput>{' '}
    </LastnameContainer>
    </FLnameContainer>
    <EmailContainer>
      <EmailTitle>Your Email</EmailTitle>
      <EmailInput
        type='text'
        placeholder='john@example.com'
      ></EmailInput>{' '}
    </EmailContainer>
    <PhoneContainer>
      <PhoneTitle>Phone number</PhoneTitle>
      <PhoneInput
        type='text'
        placeholder='+46'
      ></PhoneInput>{' '}
    </PhoneContainer>
    </FormDiv>
    <ButtonsDiv>
    <PrevBtn>HI</PrevBtn>
    <NextBtn>HI</NextBtn>
    </ButtonsDiv>
</Section>
  )
}
}
export default About;
